#!/usr/bin/python3
sequence=''
compteurA=0
compteurT=0
compteurC=0
compteurG=0
s=len(sequence)

for n in range(s):
	if sequence[n]=="A": 
		compteurA+=1
	if sequence[n] is "T":
		compteurT+=1
	if sequence[n] is  "C":
		compteurC+=1
	if sequence[n] is "G":
		compteurG+=1

print ("%s %s %s %s"%(compteurA, compteurT, compteurC, compteurG))
